import { useState } from "react";

import calendaricon from "../images/calendar_icon.png";

function SearchFilter() {

    const [destination, setDestination] = useState("");
    const [checkInDate, setCheckInDate] = useState(new Date());
    const [checkOutDate, setCheckOutDate] = useState(new Date());
    const [guests, setGuests] = useState(0);

    function handleSubmit(event) {
        event.preventDefault();
        console.log(destination, checkInDate, checkOutDate, guests);
    }

    return(
        <div className="SearchFilter">
            <img src={calendaricon}/>
            <form onSubmit={handleSubmit}>
                <label>Destination<br></br> <input type="text" name="destination" value={destination} onChange={(e) => setDestination(e.target.value)}/></label>
                <label>Check in<br></br> <input type="date" name="checkInDate" value={checkInDate} onChange={(e) => setCheckInDate(e.target.value)}/></label>
                <label>Check out<br></br> <input type="date" name="checkOutDate" value={checkOutDate} onChange={(e) => setCheckOutDate(e.target.value)}/></label>
                <label>Guests<br></br> <input type="number" name="guests" value={guests} onChange={(e) => setDestination(e.target.value)}/></label>
                <label>Check availability<br></br> <input type="submit"/></label>
            </form>
        </div>
    )
}

export default SearchFilter;
